import React, { FC } from "react";
import { CircleToBlockLoading } from "react-loadingg";

const Loader: FC = () => (
  <CircleToBlockLoading
    color="#3897f0"
    style={{ zIndex: 10000, background: "rgba(0,0,0,0.5)" }}
  />
);

export default Loader;
